INSERT INTO `phq_question` (`id`, `question`) VALUES
(1, 'รู้สึกซึม เศร้า หงุดหงิด หรือสิ้นหวัง'),
(2, 'เบื่อ ไม่ค่อยสนใจหรือไม่เพลิดเพลิน เวลาทำสิ่งต่างๆ'),
(3, 'นอนหลับยาก รู้สึกง่วงทั้งวัน หรือนอนมากเกินไป'),
(4, 'ไม่อยาก อาหาร น้ำหนักลด หรือกินมากกว่าปกติ'),
(5, 'รู้สึกเหนื่อยล้า หรือไม่ค่อยมีพลัง'),
(6, 'รู้สึกแย่กับตัวเอง หรือคิดว่าตัวเองล้มเหลว หรือทำให้ตัวเอง\r\nหรือครอบครัวผิดหวัง'),
(7, 'จดจ่อกับสิ่งต่างๆได้ยาก เช่น ทำการบ้าน อ่านหนังสือ\r\nหรือดูโทรทัศน์'),
(8, 'พูดหรือทำอะไรช้าลงมาก จนคนอื่นสังเกตเห็นได้\r\nหรือในทางตรงกันข้ามคือกระสับกระส่ายหรือ\r\nกระวนกระวาย จนต้องเคลื่อนไหวไปมากกว่าปกติ'),
(9, 'คิดว่าถ้าตายไปเสียจะดีกว่า หรือคิดจะทำร้ายตนเอง\r\nด้วยวิธีใดวิธีหนึ่ง'),
(10, 'ใน 1 เดือน ที่ผ่านมา มีช่วงไหนที่คุณมีความคิด\r\nอยากตายหรือไม่อยากมีชีวิตอยู่อย่างจริงจังหรือไม่'),
(11, 'ตลอดชีวิตที่ผ่านมาคุณเคยพยายาม\r\nที่จะทำให้ตัวเองตายหรือลงมือฆ่าตัวตายหรือไม่'),
(12, 'ความเครียดของหนูเกิดจากปัญหาเรื่องใดมากที่สุด\r\nเช่น การเรียน เพื่อน ครอบครัว'),
(13, 'หนูคิดว่าความสามารถในการจัดการความเครียดได้ด้วย\r\nตัวเองอยู่ในระดับใด เช่น ดีมาก ดี ค่อนข้างน้อย ไม่ได้เลย');
